import {useEffect,useState} from 'react'
import {createClient} from 'contentful'
import {Link} from 'react-router-dom'
import client from './client.js' 
import Navbar from './Navbar.js'
import Footer from './Footer.js'
import { useParams} from 'react-router-dom'
function BlogPage()  {
	const [blogPosts, setBlogPosts] = useState([])
        useEffect(() => {
	const getAllEntries =  async () => {
		try {
		await client.getEntries().then((entries) => {
		console.log(entries)
		setBlogPosts(entries)
		}
		)
		}
		catch (error) {
		console.log("error")
		}
	}
		getAllEntries()
	}, [])

return (
	<>
	<div className="my-[29%]"> </div>
	<h1 className="text-slate-400 text-9xl translate-y-[-430%] translate-x-[40%]"> Blog </h1>
	{blogPosts?.items?.map((post) => { 
	return (
	<section key={post.sys.id}>
		<div>
	<Link to={`blog/${post.fields.slug}`} className="w-fit"> <h1 className="relative text-white text-7xl translate-y-[-700%] translate-x-[140%] hover:text-slate-400 w-fit">{post.fields.title} </h1> </Link>
	<p className="text-white text-3xl translate-y-[-1550%] translate-x-[350%] w-fit"> {post.fields.date} </p>
		</div>
	</section>
	)
	}
	)
	}
	<div className="">
	<div className="relative translate-y-[-80%]">
	<Navbar />
	</div>
	</div>
	<div className="mt-[70%] translate-x-[-3%]">
	<Footer />
	</div>
	</>
)	

}

export default BlogPage
